import React from 'react';

const TeacherPage = () => {
  return (
    <div className="container mx-auto px-4 py-8">
      <h1 className="text-3xl font-bold text-gray-900 mb-8">Teacher Dashboard</h1>
      <div className="bg-white shadow rounded-lg p-6">
        <p className="text-gray-600 mb-4">Welcome to your teacher dashboard.</p>
        <p className="text-gray-600">Teacher features will be implemented here.</p>
      </div>
    </div>
  );
};

export default TeacherPage;
